import React from 'react';
import Button from '@material-ui/core/Button';
import './App.css';


function Buttons() {    
    return (
      <div>
<Button className='Buttons'>
Sommaire
</Button>
<Button className='Buttons'>
Bio
</Button>
<Button disabled className='Buttons'>
Compétences
</Button>
<Button href="#text-buttons" className='Buttons'>
Réalisations
</Button>  
    </div>)
}


export default Buttons;
